import React from 'react';
import s from './Profile.module.css';

const Profile = (props) => {

    let translateInterests={
        "sport": 'Спорт',
        "creation": 'Творчество',
        "music": 'Музыка',
        "literature": 'Литература',
        "film": 'Кино',
        "science": 'Наука',
        "cars": 'Автомобили',
        "technology": 'Техника',
        "politics": 'Политика',
        "travel": 'Путешествие',
        "cooking": 'Кулинария',
        "art": 'Искусство',
        "games": 'Игры',
        "craft": 'Ремесло',
        "parenting": 'Материнство/отцовство'

    }



    let showingInterests=(obj)=>{
        let arr=[];
        let arrTr=[];
        for (let i in obj){
            if (obj[i]==1)
            {
                for (let u in translateInterests)
                      if (i==u) arr.push(translateInterests[u])
            }

        }
        return arr
    }

    return (
        <div>
            <div className={s.descriptionBlock}>
               <div>Имя пользователя: {props.profilePage.name}</div>
                <div>Рейтинг: {props.profilePage.rating}</div>
                <div>Интересы: {showingInterests(props.profilePage.interests)} </div>

            </div>
        </div>
    )
}


export default Profile;
